import React, { useEffect, useState } from 'react';
import { MetDetails } from './Matrimonyform';
import { list } from './PersonDetails';

export const Online=()=>{

    const[localArr,setLocalArr]=useState([])
    const[visual,setVisual]=useState(fase)

    const view=()=>{
        setLocalArr(list())
    }
    
    useEffect(()=>{
        view()
    },[]

    )
    return(
        <>
        <MetDetails/>
        {/* <button onClick={view} className="btn btn-outline-dark text-light"> list</button> */}
        <div className="container">
            <div className="row justify-content-center">

                <table>
                    <thead>
                        <tr>
                        <th> diaUname</th>
                        <th> diaFname</th>
                        <th> diaGen</th>
                        <th> diaQuali</th>
                        <th> diaAge</th>
                        <th> diaMblno</th>
                        <th> diaEmail</th>
                        <th> diaLang </th>
                        </tr>
                    </thead>
                    <tbody>
                        {localArr.map((elements)=>(
                            

                    
                        <tr>
                            <td>{elements.diaUname}</td>
                            <td>{elements.diaFname}</td>
                            <td>{elements.diaGen}</td>
                            <td>{elements.diaQuali}</td>
                            <td>{elements.diaAge}</td>
                            <td>{elements.diaMblno}</td>
                            <td>{elements.diaEmail}</td>
                            <td>{elements.diaLang}</td>
                        </tr>
  ))}
                    </tbody>
            
                </table>

            </div>

        </div>
        </>
    )
}
